・マジカルカーボンシリーズは炭素繊維素材、及びガラス繊維素材を特殊技術により柔軟性をもたせ特殊印刷で仕上げた高級なシートです。<br>・車種別にカットしてある為、誰でも簡単に貼るだけでドレスアップすることが可能です！<br>・素材の輝きと光沢を放ちつつ、カーボンの立体感・質感が味わえ、高級感を醸し出しながらエレガンスに仕上がります。 もちろん、シート自体に弾力性があるため、保護力も十分です。 <br><br>【対応】<br>・マツダ アクセラスポーツ BL系 <br>・2009.6～<br>・リヤエンブレム用 <br><br>●カラー：ガンメタ<br>●内容物：カーボンシート<br><br>※注意<br>・本製品は車種別専用タイプです。車種適合をお間違えないようお願いします。<br>・商品にエンブレムは含まれません。<style type="text/css">
